import React from 'react';
import './App.css';
import Services from './components/Services';
import Contact from './components/Contact';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <div className="hero-banner">
        <div className="logo-container">
          <img src="/Digitorn-loga.png" alt="Digitorn logotyp" className="banner-logo" />
          <span className="banner-logo-text">DIGITORN</span>
        </div>
      </div>
      <Services />
      <Contact />
      <Footer />
    </div>
  );
}

export default App;
